import React from "react";

export default function Income() {
  const getRows = () => {
    return [
      <tr>
        <td>1</td>
        <td>Salario</td>
        <td>15000</td>
        <td>2022-10-09</td>
        <td>Jobs</td>
      </tr>,
    ];
  };

  return (
    <table className="table">
      <thead>
        <tr>
          <th>ID</th>
          <th>Concept</th>
          <th>Amount</th>
          <th>Date</th>
          <th>Category</th>
        </tr>
      </thead>
      <tbody>{getRows}</tbody>
    </table>
  );
}
